  \"okefenokee-national-wildlife-refuge-annual-narrative-report-calendar-year-2007\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Okefenokee
  NWR and Banks Lake NWR outlines Refuge accomplishments during the 2007 calendar
  year. The report begins with an introduction to the Refuge. Highlights and weather
  conditions are summarized for the year. Information about monitoring and studies-
  including surveys and censuses and studies and investigations- is provided next.
  Habitat restoration and management projects are also covered; activities include
  wetland restoration, upland restoration, water level management, timber management,
  prescribed burning, and vegetation control. Fish and wildlife management are discussed
  next with emphasis on bird banding, disease monitoring, reintroductions, nest structures,
  and animal control. Coordination activities, such as interagency coordination, are
  outlined. The resource protection section provides an update on law enforcement,
  wildfire preparedness, permits, contaminant investigation, and land acquisition
  support. Information about public education and recreation is given including visitor
  services and outreach. Finally, comprehensive management planning and general administration
  are discussed in the Refuge planning and administration section. A 60-day general
  chronology of wildfires during 2007 is included.\",\n\t\"license_title\": \"License
